"    <div id=\"topicTitle\">",
"     Patient information: Daytime sleepiness (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H70877854\">",
"      <span class=\"h1\">",
"       What is daytime sleepiness?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Daytime sleepiness is feeling sleepy during the daylight hours, when most people are awake and alert. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H70877871\">",
"      <span class=\"h1\">",
"       What causes daytime sleepiness?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Daytime sleepiness can be caused by:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Not having good sleep habits &ndash; For example, not having enough time to sleep at night or not having a regular sleep schedule.",
"       </li>",
"       <li>",
"        A sleep disorder, such as:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Sleep apnea &ndash; People with this condition stop breathing for short periods during sleep.",
"       </li>",
"       <li>",
"        Narcolepsy &ndash; People with this condition are very sleepy in the daytime and sometimes fall asleep suddenly during normal activities.",
"       </li>",
"       <li>",
"        Insomnia &ndash; People with this condition have trouble falling or staying asleep. &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Things that disturb your sleep, such as:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Sounds &ndash; For example, if you have a new baby, he or she might cry and wake you up at night.",
"       </li>",
"       <li>",
"        Health conditions, such as restless legs syndrome or nighttime leg cramps.",
"       </li>",
"       <li>",
"        Schedule changes that affect sleep &ndash; This might include working a night shift or traveling to another time zone.",
"       </li>",
"       <li>",
"        Medicines &ndash; Certain medicines can cause daytime sleepiness.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H70877886\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;That depends on the cause of your daytime sleepiness. But you can try having good sleep habits. This means that you:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Go to bed and get up at the same time every day.",
"       </li>",
"       <li>",
"        Have drinks with caffeine in them only in the morning (these include coffee and tea).",
"       </li>",
"       <li>",
"        Avoid alcohol.",
"       </li>",
"       <li>",
"        Avoid smoking, especially in the evening.",
"       </li>",
"       <li>",
"        Lose weight if you are overweight.",
"       </li>",
"       <li>",
"        Exercise several days a week, but not right before bed.",
"       </li>",
"       <li>",
"        Stay off your back when sleeping. (This is not always possible and does not always work.)",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H70877901\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See a doctor or nurse if:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        You are often very sleepy in the daytime.",
"       </li>",
"       <li>",
"        You fall asleep in the middle of normal activities. &nbsp;",
"       </li>",
"       <li>",
"        You see or hear things that are not really there.",
"       </li>",
"       <li>",
"        When you wake up, you can&rsquo;t move right away.",
"       </li>",
"       <li>",
"        Your muscles feel weak if you laugh or get excited or angry.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H70877916\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor or nurse will decide which tests you should have. There are many different tests, but you might not need any. It depends on your age, other symptoms, and individual situation.",
"     </p>",
"     <p>",
"      A &ldquo;sleep study&rdquo; is the most common test doctors use to find the cause of daytime sleepiness. For this test, you spend the night in a sleep lab at a hospital or doctor&rsquo;s office. You are hooked up to different machines that monitor your heart rate, breathing, and other body functions. The results of the test tell your doctor or nurse if you have a sleep disorder.",
"     </p>",
"     <p>",
"      Your doctor or nurse might also ask you to keep a daily log for 1 to 2 weeks, where you keep track of how you sleep each night (",
"      <a class=\"graphic graphic_figure graphicRef87134 \" href=\"mobipreview.htm?4/53/4955\">",
"       figure 1",
"      </a>",
"      and",
"      <a class=\"graphic graphic_table graphicRef87859 \" href=\"mobipreview.htm?13/62/14318\">",
"       table 1",
"      </a>",
"      ).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H70877931\">",
"      <span class=\"h1\">",
"       How is daytime sleepiness treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;That depends on what is causing your daytime sleepiness. Treatments can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Lifestyle changes &ndash; These can include changing your work schedule, taking naps, losing weight, or avoiding caffeine and alcohol.",
"       </li>",
"       <li>",
"        Devices you wear at night &ndash; These can help people with sleep apnea. &nbsp;",
"       </li>",
"       <li>",
"        Medicines &ndash; These can help you stay awake in the daytime or sleep better at night. &nbsp;",
"       </li>",
"       <li>",
"        Surgery &ndash; A few people with sleep apnea have surgery to treat it. But most people don&rsquo;t need surgery for daytime sleepiness.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H70877946\">",
"      <span class=\"h1\">",
"       Can daytime sleepiness be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You can reduce your chances of daytime sleepiness by having good sleep habits. If your doctor or nurse prescribes medicine or a device to wear, use it exactly how he or she tells you.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H70877961\">",
"      <span class=\"h1\">",
"       What if my child gets daytime sleepiness?",
"      </span>",
"      &nbsp;&mdash;&nbsp;In children, daytime sleepiness is usually caused by not sleeping enough at night or not having good sleep habits. Some medicines can also make your child sleepy in the daytime.",
"     </p>",
"     <p>",
"      Children with daytime sleepiness can act differently from sleepy adults. For example, your child might: &nbsp;",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Have trouble paying attention in school",
"       </li>",
"       <li>",
"        Be more active than usual",
"       </li>",
"       <li>",
"        Act angry or emotional",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If you think your child might have daytime sleepiness, talk to the doctor or nurse.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H70877976\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
