"       Patient information: Sleep apnea (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?27/19/27953?source=see_link\">",
"       Patient information: Narcolepsy (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?2/16/2306?source=see_link\">",
"       Patient information: Insomnia (Beyond the Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?27/24/28035?source=see_link\">",
"       Patient information: Insomnia treatments (Beyond the Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?25/25/26003?source=see_link\">",
"       Patient information: Sleep apnea in adults (Beyond the Basics)",
"      </a>",
"     </p>",
