" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Inhaled nitric oxide in adults with pulmonary hypertension",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?38/4/38982/contributors\">",
"     Author",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?38/4/38982/contributors\">",
"     Darren B Taichman, MD, PhD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?38/4/38982/contributors\">",
"     Section Editor",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?38/4/38982/contributors\">",
"     Jess Mandel, MD",
"    </a>",
"    <br/>",
"   </div>",
